"info-description-setfillcolor":"Set the fill color. The body of the turtle is displayed in the selected color.","info-description-startpath":"Starts the recording of the turtle movement for a subsequent area filling.","info-description-fillpath":"Connects the current turtle position to the starting point and fills the closed figure with the fill color.","info-description-sqrt":"Calculate the root of the number.","info-description-isinteger":"Returns a truth value (true or false) which indicates whether the number is an integer or not.",
