"info-description-makeTurtle":"Cr\u00e9e la tortue sur la zone de dessin.","info-description-forward":"Avance la tortue du nombre de pas indiqu\u00e9.","info-description-backward":"Recule la tortue du nombre de pas indiqu\u00e9.","info-description-left":"Fait tourner la tortue sur elle-m\u00eame vers la gauche de l'angle indiqu\u00e9.","info-description-right":"Fait tourner la tortue sur elle-m\u00eame vers la droite de l'angle indiqu\u00e9.","info-description-setpencolor":"D\u00e9finit la couleur du stylo. La couleur est donn\u00e9e en anglais. La tortue re\u00e7oit une bordure de la couleur de stylo s\u00e9lectionn\u00e9e.",
"info-description-setpenwidth":"D\u00e9finit la largeur du stylo. La largeur est sp\u00e9cifi\u00e9e en pixels.","info-description-print":"\u00c9crit le texte entre les guillemets ou le r\u00e9sultat de l'expression arithm\u00e9tique dans la fen\u00eatre de sortie.","info-description-delay":"Attend quelques millisecondes avant de poursuivre l'ex\u00e9cution du programme.","info-description-ht":"Rend la tortue invisible pour que les images soient dessin\u00e9es rapidement.","info-description-st":"Rend la tortue \u00e0 nouveau visible pour voir comment elle dessine.",
"info-description-repeat":"Ex\u00e9cute une partie du programme plusieurs fois. Le corps de la boucle avec les commandes \u00e0 r\u00e9p\u00e9ter doit \u00eatre indent\u00e9 (d\u00e9cal\u00e9).","info-description-pu":"Soul\u00e8ve le stylo pour ne pas dessiner.","info-description-pd":"Abaisse le stylo pour dessiner.","info-description-dot":"Dessine un disque plein de diam\u00e8tre d \u00e0 la position actuelle de la tortue.","info-description-setheading":"Ne pas d\u00e9finir les angles relativement \u00e0 l'orientation de la tortue mais de mani\u00e8re absolue, i. par rapport \u00e0 la fen\u00eatre. Un angle de 0\u00b0 fait pointer la tortue vers le haut, un angle de 90\u00b0 la pointe vers la droite, etc.",
"info-description-heading":"Renvoie l'angle de la tortue de mani\u00e8re absolue, par rapport \u00e0 la zone de dessin.","info-description-speed":"Change la vitesse de la tortue. Si la vitesse est -1, la tortue se d\u00e9place aussi vite que possible. La tortue avance le plus lentement \u00e0 la vitesse 1.","info-description-msgDlg":'Affiche le texte dans sa propre fen\u00eatre. La fen\u00eatre doit d\'abord \u00eatre cliqu\u00e9e avec "OK" avant que le programme ne puisse se poursuivre.',"info-description-label":"Affiche le texte indiqu\u00e9 dans la zone de dessin \u00e0 la position actuelle de la tortue.",
"info-description-input":'L\'ordinateur affiche la question dans une fen\u00eatre, puis stocke la valeur saisie par l\'utilisateur dans la variable. Il existe trois variantes suppl\u00e9mentaires de cette fonction, chacune exigeant un type de donn\u00e9es sp\u00e9cifique:: inputInt("question"), inputFloat("question") et inputString("question").',"info-description-setfillcolor":"D\u00e9finit la couleur de remplissage. La couleur est indiqu\u00e9e en anglais. Le corps de la tortue est affich\u00e9 dans la couleur s\u00e9lectionn\u00e9e.",
"info-description-startpath":"Le mouvement de la tortue est enregistr\u00e9 afin que la figure dessin\u00e9e puisse \u00eatre remplie.","info-description-fillpath":"Relie la position actuelle de la tortue au point de d\u00e9part et remplit la figure ainsi form\u00e9e avec la couleur de remplissage.","info-description-sqrt":"Calcule la racine du nombre.","info-description-isinteger":"Renvoie une valeur de v\u00e9rit\u00e9 (True ou False) indiquant si le nombre est un entier ou non.","info-description-makecolor-intro":"Renvoie une couleur en notation hexad\u00e9cimale et la stocke dans la variable c. La couleur peut par exemple \u00eatre d\u00e9finie comme suit:",
"info-description-makecolor-rgb":': makeColor(R, G, B), makeColor("rgb(R,G,B)") o\u00f9 R, G et B sont des nombres entiers compris entre 0 et 255 ou des nombres \u00e0 virgules compris entre 0 et 1.',"info-description-makecolor-rgba":': makeColor(R,G,B,A), makeColor("rgba(R,G,B,A")) les valeurs pour R, G et B sont les m\u00eames que ci-dessus. A est un nombre \u00e0 virgule compris entre 0 et 1 et sp\u00e9cifie la transparence.',"info-description-makecolor-rainbow":"Arc-en-ciel","info-description-makecolor-rainbow-descr":': makeColor("rainbow", 0.5) renvoie une couleur du spectre de l\'arc-en-ciel. La seconde valeur est un nombre \u00e0 virgule compris entre 0 et 1.',
"info-description-makecolor-hexadecimal":"hexad\u00e9cimale","info-description-makecolor-hexadecimal-descr":': makeColor("#7FFFD4") la couleur est une cha\u00eene hexad\u00e9cimale.',"info-description-makecolor-colorstring":': makeColor("Aqua-Marine") la couleur est un nom de couleur en anglais.',"info-description-getpixelcolorstr":"Renvoie la couleur du pixel situ\u00e9 sous la tortue.","info-description-getpos":"Renvoie les coordonn\u00e9es de la position actuelle de la tortue sous forme de liste. La coordonn\u00e9e x peut \u00eatre interrog\u00e9e avec getPos()[0] et la coordonn\u00e9e y avec getPos()[1].",
"info-description-getx":"Renvoie les coordonn\u00e9es x de la position actuelle de la tortue.","info-description-gety":"Renvoie les coordonn\u00e9es y de la position actuelle de la tortue.","info-description-distance":"Renvoie la distance de la tortue au point (x, y).","info-description-towards":"Renvoie l'angle de la tortue (en degr\u00e9s) par rapport \u00e0 la position (x, y).","info-description-moveto":"D\u00e9place la tortue jusqu'au point (x, y) en dessinant.","info-description-setpos":"D\u00e9place la tortue jusqu'au point (x, y) sans dessiner.",
"info-description-setx":"D\u00e9place la tortue \u00e0 la coordonn\u00e9e x donn\u00e9e sans dessiner.","info-description-sety":"D\u00e9placez la tortue \u00e0 la coordonn\u00e9e y donn\u00e9e sans dessiner.","info-description-clean":"Efface la trace de la tortue. La tortue reste visible sur le terrain.","info-description-cs":"Efface la trace de la tortue et remet la tortue \u00e0 sa position de d\u00e9part au centre de la zone de dessin.","info-description-clear":"Efface la trace de la tortue. La tortue reste en place et se fait invisible.",
"info-description-onkey":"Appelle la fonction sp\u00e9cifi\u00e9e lorsque la touche indiqu\u00e9e est enfonc\u00e9e. Il faut \u00e9crire le nom de la fonction sans les parenth\u00e8ses. Pour pouvoir intercepter les frappes du clavier externe, il faut cliquer dans la zone de dessin apr\u00e8s le d\u00e9marrage du programme et appeler ensuite la fonction Screen().Listen() pour que la zone de dessin remarque la saisie.","info-description-onclick":"Invoque la fonction sp\u00e9cifi\u00e9e lors d'un clic dans la zone de dessin. Il faut \u00e9crire le nom de la fonction sans les parenth\u00e8ses. Les coordonn\u00e9es x et y du clic sont automatiquement transmises \u00e0 la fonction. Il faut ensuite appeler la fonction Screen().Listen() afin que la zone de dessin remarque la saisie.",
"info-description-listen":"Capture les clics de souris et les frappes de clavier dans la zone de dessin. Cette fonctionnalit\u00e9 est utilis\u00e9e avec Screen().onclick(..) et Screen().onkey(..). Il suffit d'appeler cette fonction une seule fois par programme.","info-contact":"Contact","info-contact-descr":"Veuillez envoyer vos demandes d'informations et suggestions concernant l'environnement de programmation directement \u00e0 Nicole Trachsler par e-mail: nicole.trachsler (at) inf.ethz.ch","info-authors":"Auteurs:",
