"info-description-speed":"Cambia la velocit\u00e0 della tartaruga. Se la velocit\u00e0 viene messa a -1, la tartaruga va il pi\u00f9 veloce che pu\u00f2. Con una velocit\u00e0 di 1 la tartaruga va il pi\u00f9 lentamente possibile","info-description-msgDlg":'Restituisci il testo nella sua piccola finestra. Si deve cliccare "OK" nella finestra, per riprendere l\'esecuzione del programma.',"info-description-label":"Stampa il testo nella superficie di disegno, alla posizione corrente della tartaruga.",
"info-description-input":'Il computer mostra la domanda in una finestra e salva il valore immesso dall\'utente nella variabile x. Ci sono tre varianti addizionali di questa funzione, ognuna delle quali richiede un tipo di dato specifico: inputInt("domanda"), inputFloat("domanda") e inputString("domanda").',"info-description-setfillcolor":"Imposta il colore delle superfici. Il corpo della tartaruga \u00e8 mostrato nel colore selezionato.","info-description-startpath":"Inizia a registrare i movimenti della tartaruga per colorare una superficie in seguito.",
"info-description-fillpath":"Connette la posizione corrente della tartaruga con la posizione iniziale e colora la figura racchiusa con il colore di superficie selezionato.","info-description-sqrt":"Calcola la radice di un numero.","info-description-isinteger":"Restituisce un valore di verit\u00e0 (true o false) che indica se il numero \u00e8 un intero oppure no.","info-description-makecolor-intro":"Restituisce un colore in notazione esadecimale e lo salva nella variabile c. Il colore pu\u00f2 essere definito come segue:",
